import './UserData.css';
import SpecificUSerData from './SpecificUserData';
// import React, { useState } from 'react';


function UserData(props) {
    // console.log(props);

    // Handle success
    let usersDetails = [];
    props.items.then(response => {
        return response.json();
    })  // convert to json
        .then((data) => {

            for (let obj of data)
                usersDetails.push(obj);

        })

    return (
        <div>

            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Email</th>
                        <th>Role</th>

                    </tr>
                </thead>
                {usersDetails.map((user) => (


                    <SpecificUSerData
                        key={user.id}
                        name={user.name}
                        email={user.email}
                        role={user.role}
                    />

                ))}
            </table>

        </div>
    );
}

export default UserData;
